import{_ as a,o as r,c as s,b as e}from"./chunks/framework.6c3c27db.js";const i="/assets/1rhYt2UMhG4.9dd3a952.jpg",t="/assets/10.e6a82fb4.jpg",S=JSON.parse('{"title":"GRASSER","description":"","frontmatter":{"title":"GRASSER","date":"2019-04-26","icon":"KnQntM_SlOg.jpg","cover":"10.jpg","address":"ул. Гатчинская, д.26","place":"м. Чкаловская, БЦ Печатный двор","city":"г. Санкт-Петербург","tel":"+7 (800) 301-59-39","vk":"grasser_ru","facebook":"grasser.ru","youtube-channel":"grasserdesign","instagram":"grasser_department","hours":"пн.-пт. с 10 до 18 по мск","status":"open"},"headers":[],"relativePath":"workshop/catalog/grasser/index.md","filePath":"workshop/catalog/grasser/index.md"}'),l={name:"workshop/catalog/grasser/index.md"},o=e('<p>Бюро GRASSER — это творческая площадка, на которой профессионалы, креативные специалисты и педагоги воплощают в жизнь ваши идеи. У нас за плечами немалый опыт в сфере легкой промышленности. Мы знаем об одежде много полезного и интересного, готовы делиться своими знаниями и опытом!</p><p>В нашей школе есть как длительные курсы по конструированию, моделированию и пошиву, так и однодневные практические уроки. Мы проводим мастер-классы на различные темы в области модной индустрии (материаловедение, терминология конструирования, особенности пошива изделий из различных тканей и другие). В нашей школе учатся студенты с разной степенью подготовки. Программы курсов различны, разработаны непосредственно нами и являются ценной интеллектуальной собственностью GRASSER. Мы практики, а не теоретики, так как каждый день сотрудники-преподаватели бюро GRASSER работают с разными клиентами. В своей работе мы используем самые последние тенденции моделирования и конструирования одежды.</p><p><img src="'+i+'" alt=""></p><h3 id="коворкинг-grasser-в-москве" tabindex="-1">Коворкинг Grasser в Москве <a class="header-anchor" href="#коворкинг-grasser-в-москве" aria-label="Permalink to &quot;Коворкинг Grasser в Москве&quot;">​</a></h3><h5 id="коворкинг-grasser-–-это-пространство-где-вас-окружают-люди-по-настоящему-увлеченные-своеи-работои" tabindex="-1">Коворкинг Grasser – это пространство, где вас окружают люди, по-настоящему увлечённые своей работой. <a class="header-anchor" href="#коворкинг-grasser-–-это-пространство-где-вас-окружают-люди-по-настоящему-увлеченные-своеи-работои" aria-label="Permalink to &quot;Коворкинг Grasser – это пространство, где вас окружают люди, по-настоящему увлечённые своей работой.&quot;">​</a></h5><p>Количество занятий: абонемент на 5/10/15/25 часов действует в течение месяца</p><p>Это возможность поработать в центре города в стенах нашей школы над собственными проектами, используя все преимущества мастерских Grasser.</p><h5 id="мастерские-grasser-в-москве-это" tabindex="-1">Мастерские Grasser в Москве это: <a class="header-anchor" href="#мастерские-grasser-в-москве-это" aria-label="Permalink to &quot;Мастерские Grasser в Москве это:&quot;">​</a></h5><ul><li>3 полностью оборудованных цеха</li><li>6 больших раскройных столов</li><li>22 промышленных прямострочных машины</li><li>5 промышленных оверлоков</li><li>4 промышленных утюжильных стола</li><li>4 промышленных парогенератора</li><li>промышленная и бытовая плоскошовная машины</li><li>пресс для дублирования деталей</li><li>8 портновских манекенов</li><li>7 бытовых машин</li><li>4 бытовых оверлока</li><li>все необходимые инструменты для пошива (ножницы, булавки, линейки и т.д.)</li></ul><p>А ещё это:</p><ul><li>волшебная атмосфера, крутая компания и чай, кофе, печеньки</li><li>библиотека</li><li>магазин, где можно купить товары для шитья, а ещё макетную бязь и итальянскую ткань</li></ul><p><img src="'+t+'" alt=""></p><p>Наличие свободных мест уточняйте у администратора по телефону. Посещение необходимо согласовать не позднее, чем за три часа, с администрацией школы.</p><p>Пользование коворкингом не включает в себя консультации с мастером или преподавателем. Если вам необходима помощь наших мастеров, сообщите об этом заранее.</p><p>Если вы не являетесь студентом или выпускником нашей школы, предварительно необходимо будет пройти инструктаж по технике безопасности и работе на нашем оборудовании.</p><p>До встречи в Grasser Москва!</p>',16),p=[o];function n(c,_,d,h,g,u){return r(),s("div",null,p)}const G=a(l,[["render",n]]);export{S as __pageData,G as default};
